bool scanToNextToken(std::string token, std::stringstream &ssText)
{
	std::string temp;
	while ( ssText >> temp )
	{
		if ( temp == token )
		{	// Got is
			return true;
		}
	}
	// Scanned the entire string and didn't find it
	return false;
}


bool cDebugRenderer::QnD_convertIndexedXYZPlyFileToTriangleOnlyVertices( std::string fileName, std::vector<sDebugTri> &vecTris )
{
	std::ifstream plyFile(fileName.c_str());
	if ( ! plyFile.is_open() )
	{
		return false;
	}

	plyFile.seekg(0, std::ios::end);
	// reutrns "std::ios::pos_type" type (which seems to be int in VC++)
	unsigned int fileSize = static_cast<unsigned int>( plyFile.tellg() );	
	// Return to start
	plyFile.seekg(0, std::ios::beg);
		
	char* pRawData = new char[ fileSize ];
	// read the file
	plyFile.read( pRawData, fileSize );
	plyFile.close();

	std::stringstream ssPlyText(pRawData);

	delete [] pRawData;

	return this->QnD_convertIndexedXYZPlyToTriangleOnlyVertices(ssPlyText.str(), vecTris);
}

// Quick-n-Dirty utility to convert ply format to "flat" (only triangle) format
bool cDebugRenderer::QnD_convertIndexedXYZPlyToTriangleOnlyVertices( const std::string &plyText, std::vector<sDebugTri> &vecTris )
{
	// Incoming format should be: 
	//	ply
	//	format ascii 1.0
	//	comment VCGLIB generated
	//	element vertex 642
	//	property float x
	//	property float y
	//	property float z
	//	element face 1280
	//	property list uchar int vertex_indices
	//	end_header
	//	0 -1 0 
	//	-0.096471 -0.992865 -0.070089 
	//	0.036848 -0.992865 -0.113408 

	std::stringstream ssPlyText(plyText);

	if ( ! scanToNextToken("vertex", ssPlyText) ) { return false; }
	int numVerts = 0;
	ssPlyText >> numVerts;
	
	if ( ! scanToNextToken("face", ssPlyText) ) { return false; }
	int numFaces = 0;
	ssPlyText >> numFaces;
	
	if ( ! scanToNextToken("end_header", ssPlyText) ) { return false; }
	// Next item is the 1st vertex

	// Here's now this works: 
	// - the vertices are loaded into a temp vector of vertices, 
	// - Then, as the triangles indices are loaded, the ACTUAL vecTris vector 
	//   is created, by looking up the temp vertex list
	std::vector<glm::vec3> vecIndexVertices;
	glm::vec3 tempVert;
	for ( int count = 0; count != numVerts; count++ )
	{
		ssPlyText >> tempVert.x >> tempVert.y >> tempVert.z;
		vecIndexVertices.push_back(tempVert);
	}

	vecTris.clear();
	vecTris.reserve(numFaces);

	int vIndices[3] = {0};	int discard = 0;
	sDebugTri curTriangle;
	for ( int count = 0; count != numFaces; count++ )
	{
		ssPlyText >> discard /*3*/ >> vIndices[0] >> vIndices[1] >> vIndices[2];
		curTriangle.v[0] = vecIndexVertices[vIndices[0]];
		curTriangle.v[1] = vecIndexVertices[vIndices[1]];
		curTriangle.v[2] = vecIndexVertices[vIndices[2]];
		vecTris.push_back(curTriangle);
	}

	return true;
}

std::string add_an_f( float num )
{
	
	std::stringstream ssNum;
	ssNum << std::setprecision(10) << num;
	// Scan for the decimal
	if ( ssNum.str().find_first_of(".") == std::string::npos )
	{	// No decimal
		ssNum << ".0";
	}
	ssNum << "f";
	return ssNum.str();
}


// This converts a vector of sDebugTris into a header file representation
// "arrayName" is the name of the array and the size value:
// - arrayName+"_array" for the array		(example: "float teapot_array[] = ...")
// - arrayName+"_array_size" for the size	(example: "unsigned int teapot_array_size = ...")
// NOTE: Size is the TOTAL number of floats, so 3x the number of triangles. 
//       You pass this TOTAL number info the loadHeaderArrayInto_vecTri() method.
bool cDebugRenderer::QnD_convert_vecTri_to_array_header( std::vector<sDebugTri> &vecTris, std::string arrayName, 
														 std::string &arrayText, std::string outputFileName /*=""*/ )
{
	std::stringstream ssArray;

	std::string arrayFullVariableName = arrayName + "_array";
	std::string arraySizeVariableName = arrayFullVariableName + "_size";

	ssArray << "float " << arrayFullVariableName << " [] = { \n";
	unsigned int numTris = static_cast<unsigned int>(vecTris.size());
	for ( unsigned int index = 0; index != numTris; index++ )
	{
		// f = 1.2;
		//cout << f;
		//cout << left << setfill('0') << setw(4) << f << "\n";

		sDebugTri& curTri = vecTris[index];
		ssArray << "/*v0*/ " << add_an_f(curTri.v[0].x) << ", " << add_an_f(curTri.v[0].y) << ", " << add_an_f(curTri.v[0].z) << ",  ";
		ssArray << "/*v1*/ " << add_an_f(curTri.v[1].x) << ", " << add_an_f(curTri.v[1].y) << ", " << add_an_f(curTri.v[1].z) << ",  ";
		ssArray << "/*v2*/ " << add_an_f(curTri.v[2].x) << ", " << add_an_f(curTri.v[2].y) << ", " << add_an_f(curTri.v[2].z) << "";
		if ( index < (numTris-1) )
		{	// Don't put a comma on the very last line
			ssArray << ",";
		}
		ssArray << "\n";
	}
	ssArray << "};\n\n";

	ssArray << "unsigned int " << arrayFullVariableName << "_size = " << vecTris.size() * 3 * 3 << ";\n\n";

	arrayText = ssArray.str();

	// Save to file? 
	if ( outputFileName != "" )
	{
		std::ofstream outFile(outputFileName);
		if ( outFile.is_open() )
		{
			outFile << arrayText;
			outFile.close();
		}
	}//if ( outputFileName != "" )

	return true;
}

// NOTE: Size is the TOTAL number of floats, so 3x the number of triangles. 
//       You pass this TOTAL number info the loadHeaderArrayInto_vecTri() method.
bool cDebugRenderer::QnD_loadHeaderArrayInto_vecTri( float* shapeArray, int sizeOfArray, std::vector<sDebugTri> &vecTris )
{
	vecTris.clear();
	sDebugTri curTri;
	for ( int index = 0; index != sizeOfArray; index += 9 )	// 3 vertices x 3 float per vertex
	{
		// /*v0*/ -0.5770670176f, -0.5863329768f, -0.5685129762f,  
		// /*v1*/ -0.6753000021f, -0.5506849885f, -0.4906280041f,  
		// /*v2*/ -0.6384519935f, -0.4769870043f, -0.6040380001f,

		curTri.v[0].x = shapeArray[index + 0];
		curTri.v[0].y = shapeArray[index + 1];
		curTri.v[0].z = shapeArray[index + 2];

		curTri.v[1].x = shapeArray[index + 3];
		curTri.v[1].y = shapeArray[index + 4];
		curTri.v[1].z = shapeArray[index + 5];

		curTri.v[2].x = shapeArray[index + 6];
		curTri.v[2].y = shapeArray[index + 7];
		curTri.v[2].z = shapeArray[index + 8];

		vecTris.push_back(curTri);
	}
		
	return true;
}

