// Generates a isosphere. 
// numIterations = 1 gives 12 points and 20 triangles
// 2 or more is number of recursive subdivides, so 2 = 20x4 = 80 triangles
// More than 4 or 5 is pretty crazy for a debug shape.
// Taken from: http://blog.andreaskahler.com/2009/06/creating-icosphere-mesh-in-code.html
void cDebugRenderer::generateIsoSphere( unsigned int numIterations, float radius, std::vector<sDebugTri> &vecTris )
{
	// create 12 vertices of a icosahedron
	float t = (1.0f + glm::sqrt(5.0f))/2.0f;

	std::vector<glm::vec3> vecPoints;
	vecPoints.push_back( glm::vec3( -1.0f,  t, 0.0f ) );
	vecPoints.push_back( glm::vec3( -1.0f,  t, 0.0f ) );
	vecPoints.push_back( glm::vec3(  1.0f,  t, 0.0f ) );
	vecPoints.push_back( glm::vec3( -1.0f, -t, 0.0f ) );
	vecPoints.push_back( glm::vec3(  1.0f, -t, 0.0f ) );

	vecPoints.push_back( glm::vec3( 0.0f, -1.0f,  t ) );
	vecPoints.push_back( glm::vec3( 0.0f,  1.0f,  t ) );
	vecPoints.push_back( glm::vec3( 0.0f, -1.0f, -t ) );
	vecPoints.push_back( glm::vec3( 0.0f,  1.0f, -t ) );

	vecPoints.push_back( glm::vec3(  t,  0.0f, -1.0f ) );
	vecPoints.push_back( glm::vec3(  t,  0.0f,  1.0f ) );
	vecPoints.push_back( glm::vec3( -t,  0.0f, -1.0f ) );
	vecPoints.push_back( glm::vec3( -t,  0.0f,  1.0f ) );

	// create 20 triangles of the icosahedron
	vecTris.clear();

	// 5 faces around point 0
	vecTris.push_back( sDebugTri( vecPoints[0], vecPoints[11], vecPoints[5] ));
	vecTris.push_back( sDebugTri( vecPoints[0], vecPoints[5], vecPoints[1] ));
	vecTris.push_back( sDebugTri( vecPoints[0], vecPoints[1], vecPoints[7] ));
	vecTris.push_back( sDebugTri( vecPoints[0], vecPoints[7], vecPoints[10] ));
	vecTris.push_back( sDebugTri( vecPoints[0], vecPoints[10], vecPoints[11] ));

	// 5 adjacent faces
	vecTris.push_back( sDebugTri( vecPoints[1], vecPoints[5], vecPoints[9] ));
	vecTris.push_back( sDebugTri( vecPoints[5], vecPoints[11], vecPoints[4] ));
	vecTris.push_back( sDebugTri( vecPoints[11], vecPoints[10], vecPoints[2] ));
	vecTris.push_back( sDebugTri( vecPoints[10], vecPoints[7], vecPoints[6] ));
	vecTris.push_back( sDebugTri( vecPoints[7], vecPoints[1], vecPoints[8] ));

	// 5 faces around point 3
	vecTris.push_back( sDebugTri( vecPoints[3], vecPoints[9], vecPoints[4] ));
	vecTris.push_back( sDebugTri( vecPoints[3], vecPoints[4], vecPoints[2] ));
	vecTris.push_back( sDebugTri( vecPoints[3], vecPoints[2], vecPoints[6] ));
	vecTris.push_back( sDebugTri( vecPoints[3], vecPoints[6], vecPoints[8] ));
	vecTris.push_back( sDebugTri( vecPoints[3], vecPoints[8], vecPoints[9] ));

	// 5 adjacent faces
	vecTris.push_back( sDebugTri( vecPoints[4], vecPoints[9], vecPoints[5] ));
	vecTris.push_back( sDebugTri( vecPoints[2], vecPoints[4], vecPoints[11] ));
	vecTris.push_back( sDebugTri( vecPoints[6], vecPoints[2], vecPoints[10] ));
	vecTris.push_back( sDebugTri( vecPoints[8], vecPoints[6], vecPoints[7] ));
	vecTris.push_back( sDebugTri( vecPoints[9], vecPoints[8], vecPoints[1] ));

	return;
}

