unsigned int cDebugRenderer_default_sphere_array_size = 11520;

// This is used to load the hard coded sphere
void cDebugRenderer::generateDefaultSphereMesh(std::vector<sDebugTri> &vecTris )
{
	vecTris.clear();

	// /*v0*/ 0.0f, -1.0f, 0.0f,  /*v1*/ -0.09647099674f, -0.992865026f, -0.07008899748f,  /*v2*/ 0.03684800118f, -0.992865026f, -0.1134079993f,
	// Increment is by 9, because there are 3 coordinates per triangle and 3 vertices per triangle
	for ( unsigned int index = 0; index < cDebugRenderer_default_sphere_array_size; index += 9 )
	{
		sDebugTri tempTri;
		tempTri.v[0].x = cDebugRenderer_default_sphere_array[index + 0];
		tempTri.v[0].y = cDebugRenderer_default_sphere_array[index + 1];
		tempTri.v[0].z = cDebugRenderer_default_sphere_array[index + 2];

		tempTri.v[1].x = cDebugRenderer_default_sphere_array[index + 3];
		tempTri.v[1].y = cDebugRenderer_default_sphere_array[index + 4];
		tempTri.v[1].z = cDebugRenderer_default_sphere_array[index + 5];

		tempTri.v[2].x = cDebugRenderer_default_sphere_array[index + 6];
		tempTri.v[2].y = cDebugRenderer_default_sphere_array[index + 7];
		tempTri.v[2].z = cDebugRenderer_default_sphere_array[index + 8];

		vecTris.push_back( tempTri );
	}

	return;
}
